class Solution:
    def solution(self, input_str: str) -> str:
        n, stones = input_str.split("\n")
        n = int(n)
        stones = list(map(int, stones.split()))
        if n == 1:
            return "cslnb"
        stones_dict = {i: stones[i] for i in range(n)}
        stones_dict = dict(sorted(stones_dict.items(), key=lambda x: x[1], reverse=True))
        for key, value in stones_dict.items():
            if value == 0:
                return "cslnb"
        prev_sum = sum(stones_dict.values())
        for key, value in stones_dict.items():
            if value == prev_sum:
                return "sjfnb"
        return "cslnb"
